import React, {Component} from 'react';
import './style.css';

class Vote extends Component{
  render(){
    return(
      <div>
        <header>
          <h1>Ideation Pool</h1>
          <p>Vote on the most useful idea!</p>
        </header>

        <div className="Vrow">
          <div className="Vcolumn" >
            <img src="http://worldartsme.com/images/solution-clipart-1.jpg"/>
          </div>
        </div>

      </div>
    )
  }
}
export default Vote;
